import React, { useEffect } from "react";
import AOS from "aos";
import "aos/dist/aos.css";
import "./Home.css";
import imgProfile from "../img/3Iki2GeMqojXZtpTDg0C_64215869d7220_cvtpl.jpg";

export default function HomePage() {
  useEffect(() => {
    // Khởi tạo thư viện AOS
    AOS.init({
      duration: 1000, // Độ dài thời gian của hiệu ứng (milliseconds)
    });
  }, []);
  return (
    <>
      <div>
        <img src={imgProfile} alt="" className="img-profile" />
        <h3 className="mt-3">LÊ XUÂN THỐNG</h3>
        <p>FRONT-END REACT DEVELOPER JAVASCRIPT </p>
      </div>
      <div className="container mt-5">
        <div className="row">
          <div className="col-2"></div>
            <div className="col-4">
              <h5>THÔNG TIN CÁ NHÂN & LIÊN HỆ</h5>
              <div className="text-left mt-5">
                <p>PHONE : 0971471796</p>
                <p>EMAIL : thongxuan327@gmail.com</p>
                <p>GIT : https://github.com/thong1403</p>
                <p>ADDRESS : 508 Đường Láng</p>
              </div>
            </div>
            <div className="col-4 ">
              <h5>GIỚI THIỆU BẢN THÂN</h5>
              <p className="mt-5">Theo đánh giá của cá nhân tôi và mọi người trong môi trường làm việc thì tôi là một người vui vẻ, hòa đồng, nghiêm túc trong công việc và luôn muốn tìm tòi và học hỏi những kiến thức mới.</p>
          </div>
          <div className="col-2"></div>
        </div>
      </div>
    </>
  );
}
